import React from 'react';
import Card from './Cards';
import Sdata from './Sdata';

const Netflix = (val) => {
    console.log(val.site);
    if(val.site === "netflix"){
        return (
            <Card  
                key = {val.id}
                imgsrc={val.imgsrc}
                title={val.title}
                sname={val.sname}
                link={val.link}
            />
         );
    }
}



